import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { createProperty, getPropertyEnums } from '../api/propertyService'; // Добавим getClients для получения списка клиентов
import {getClientsByManager} from '../api/ClientService'
import '../styles/CreatePropertyForm.css';

const CreatePropertyForm = ({ onSuccess }) => {
    const navigate = useNavigate();
    const [selectedClientId, setSelectedClientId] = useState('');
    const [clients, setClients] = useState([]); // Состояние для списка клиентов

    const [formData, setFormData] = useState({
        address: {
            city: '',
            street: '',
            building: ''
        },
        rooms: '',
        price: '',
        floor: '',
        propertyLevel: '',
        description: '',
        owner: '',
        propertyType: '',
        status: 'AVAILABLE',
        hasBalcony: false,
        allowPets: false
    });

    const [enumValues, setEnumValues] = useState({
        propertyTypes: [],
        propertyLevels: [],
        statuses: []
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState('');

    useEffect(() => {
        const fetchEnums = async () => {
            try {
                const data = await getPropertyEnums();
                setEnumValues({
                    propertyTypes: data.propertyTypes || [],
                    propertyLevels: data.propertyLevels || [],
                    statuses: data.statuses || [],

                });
            } catch (err) {
                console.error('Ошибка загрузки enum значений:', err);
            }
        };

        const fetchClients = async () => {
            try {
                const managerId = localStorage.getItem('managerId'); // <-- обязательно!
                console.log('managerId from localStorage:', localStorage.getItem('managerId'));

                if (!managerId) {
                    console.error('Manager ID not found!');
                    return;
                }
                const data = await getClientsByManager(managerId);
                console.log('Клиенты менеджера:', data);
                setClients(data || []);
            } catch (err) {
                console.error('Ошибка загрузки клиентов:', err);
            }
        };

        fetchEnums();
        fetchClients();
    }, []);

    const handleClientChange = (e) => {
        const clientId = e.target.value;
        setSelectedClientId(clientId);
        setFormData(prev => ({
            ...prev,
            owner: clientId // Обновляем поле owner в formData
        }));
    };

    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;

        if (name.startsWith('address.')) {
            const addressField = name.split('.')[1];
            setFormData(prev => ({
                ...prev,
                address: {
                    ...prev.address,
                    [addressField]: value
                }
            }));
        } else if (type === 'checkbox') {
            setFormData(prev => ({
                ...prev,
                [name]: checked
            }));
        } else {
            setFormData(prev => ({
                ...prev,
                [name]: value
            }));
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setError('');

        try {
            const payload = {
                ...formData,
                rooms: parseInt(formData.rooms),
                price: parseFloat(formData.price),
                floor: parseInt(formData.floor),
                owner: {
                    id: parseInt(formData.owner) 
                }
            };
            console.log('Отправляемые данные:', payload);

            await createProperty(payload);

            if (onSuccess) {
                await onSuccess(); // обновляем данные менеджера
            }

            navigate('/properties'); // или оставайтесь на текущей странице
        } catch (err) {
            setError(err.response?.data?.message || 'Ошибка при создании недвижимости');
            console.error('Ошибка:', err);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="create-property-container">
            <h2>Добавить новую недвижимость</h2>

            {error && <div className="error-message">{error}</div>}

            <form onSubmit={handleSubmit} className="property-form">
                <div className="form-section">
                    <h3>Основная информация</h3>

                    <div className="form-group">
                        <label>Тип недвижимости:</label>
                        <select
                            name="propertyType"
                            value={formData.propertyType}
                            onChange={handleChange}
                            required
                        >
                            <option value="">Выберите тип</option>
                            {enumValues.propertyTypes.map(type => (
                                <option key={type} value={type}>{type}</option>
                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label>Клиент:</label>
                        <select
                            value={selectedClientId}
                            onChange={handleClientChange}
                            required
                        >
                            <option value="">-- Выберите клиента --</option>
                            {clients.map(client => (
                                <option key={client.id} value={client.id}>
                                    {client.authUser ? `${client.authUser.lastname} ${client.authUser.firstname}` : `Клиент #${client.id}`}

                                </option>

                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label>Количество комнат:</label>
                        <input
                            type="number"
                            name="rooms"
                            value={formData.rooms}
                            onChange={handleChange}
                            min="1"
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Цена:</label>
                        <input
                            type="number"
                            name="price"
                            value={formData.price}
                            onChange={handleChange}
                            min="0"
                            step="100"
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Этаж:</label>
                        <input
                            type="number"
                            name="floor"
                            value={formData.floor}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Уровень:</label>
                        <select
                            name="propertyLevel"
                            value={formData.propertyLevel}
                            onChange={handleChange}
                        >
                            <option value="">Выберите уровень</option>
                            {enumValues.propertyLevels.map(level => (
                                <option key={level} value={level}>{level}</option>
                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label>Статус:</label>
                        <select
                            name="status"
                            value={formData.status}
                            onChange={handleChange}
                            required
                        >
                            {enumValues.statuses.map(status => (
                                <option key={status} value={status}>{status}</option>
                            ))}
                        </select>
                    </div>

                    <div className="form-group">
                        <label>Описание:</label>
                        <textarea
                            name="description"
                            value={formData.description}
                            onChange={handleChange}
                            rows="4"
                        />
                    </div>
                </div>

                <div className="form-section">
                    <h3>Адрес</h3>

                    <div className="form-group">
                        <label>Город:</label>
                        <input
                            type="text"
                            name="address.city"
                            value={formData.address.city}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Район:</label>
                        <input
                            type="text"
                            name="address.district"
                            value={formData.address.district}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Улица:</label>
                        <input
                            type="text"
                            name="address.street"
                            value={formData.address.street}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group">
                        <label>Номер дома:</label>
                        <input
                            type="text"
                            name="address.building"
                            value={formData.address.building}
                            onChange={handleChange}
                            required
                        />
                    </div>

                    <div className="form-group checkbox-group">
                        <label className="checkbox-label">
                            <input
                                type="checkbox"
                                name="hasBalcony"
                                checked={formData.hasBalcony}
                                onChange={handleChange}
                                className="checkbox-input"
                            />
                            <span className="checkbox-custom"></span>
                            Наличие балкона
                        </label>
                    </div>

                    <div className="form-group checkbox-group">
                        <label className="checkbox-label">
                            <input
                                type="checkbox"
                                name="allowPets"
                                checked={formData.allowPets}
                                onChange={handleChange}
                                className="checkbox-input"
                            />
                            <span className="checkbox-custom"></span>
                            Разрешены животные
                        </label>
                    </div>
                </div>

                <button type="submit" disabled={loading} className="submit-button">
                    {loading ? 'Создание...' : 'Создать недвижимость'}
                </button>
            </form>
        </div>
    );
};

export default CreatePropertyForm;
